import React from "react";
import { useState } from "react";

export default function HomeInputFields() {
  const [value, setValue] = useState("");

  const onChange = (event) => {
    setValue(event.target.value);
  };
  return (
    <div>
      <input type="name"></input>
    </div>
  );
}
